import {SHOW_COORDENATES} from '../actions'

const initialState = {
    list:[{id:0,lat:12345}]
}

export function showCoordenates(state = initialState,action){
    switch(action.type){
        case SHOW_COORDENATES:
            return Object.assign({},state,{list:action.payload})
        default:
            return state
    }
}
